setCombatArea(combat2, area2)

local area3 = createCombatArea(arr3)
setCombatArea(combat3, area3)

local function onCastSpell1(parameters)
    doCombat(parameters.cid, parameters.combat1, parameters.var)
end

local function onCastSpell2(parameters)
    doCombat(parameters.cid, parameters.combat2, parameters.var)
end

local function onCastSpell3(parameters)
    doCombat(parameters.cid, parameters.combat3, parameters.var)
end

function onTargetTile2(cid, pos)
doSendDistanceShoot({x = pos.x, y = pos.y - 27, z = pos.z}, pos, 28)
doSendDistanceShoot({x = pos.x, y = pos.y - 31, z = pos.z}, {x = pos.x, y = pos.y - 60, z = pos.z}, 28)
end

setCombatCallback(combat2, CALLBACK_PARAM_TARGETTILE, "onTargetTile2")

function onTargetTile3(cid, pos)
doSendDistanceShoot({x = pos.x - 28, y = pos.y, z = pos.z}, pos, 28)
doSendDistanceShoot({x = pos.x - 32, y = pos.y, z = pos.z}, {x = pos.x - 61, y = pos.y, z = pos.z}, 28)

end

setCombatCallback(combat3, CALLBACK_PARAM_TARGETTILE, "onTargetTile3")

function onCastSpell(cid, var)

local parameters = { cid = cid, var = var, combat1 = combat1, combat2 = combat2, combat3 = combat3 }
addEvent(onCastSpell2, 180, parameters)
addEvent(onCastSpell3, 180, parameters)
addEvent(onCastSpell1, 200, parameters)
end